import React, {useState} from 'react';

const ViewObject = ({ valObject, handleClick=undefined }) => {
    const keys = Object.keys(valObject);
    const [expanded, setExpanded] = useState(false);

    const parseObject = ({key, value}) => {
        if (typeof value === 'string' || typeof value === 'number' || typeof value === 'boolean') {
            return (
                <div>
                    <span>{key}: </span>
                    <span>{value}</span>
                </div>
              )
        } else if (typeof value === 'object') {
            const handleChildClick = () => {
                setExpanded(!expanded);
                console.log('expanded', expanded);
            };
            return (
                <button onClick={handleClick} style={{marginLeft: '5px'}}>
                    <span>{key}:</span>
                    { expanded ?
                        <ViewObject valObject={value} handleClick={handleChildClick} />
                        :
                        <span>...</span>
                    }
                </button>
            )
        } else {
            return null;
        }
    };
    return (
        <div>
            { keys.map(key => {
              return (
                <div>
                    {parseObject({key, value: valObject[key]})}
                </div>
            )})}
        </div>
    );
}

export default ViewObject;
